?><p style="text-align: justify;"><span style="font-size: medium;"><span style="font-family: &quot;Times New Roman&quot;;">Данная часовая компания начала функционировать с середины 20-го века, с 1950 года. Именно тогда, один из создателей компании Альберт Вэйс, начинает производство стальных браслетов для наручных часов. Спустя 6 лет, он принимает решение о создании часовой компании вместе с Иосифом Олегом. Так, в 1956 году, на территории Цюриха начинает функционировать новая компания по производству часов, под названием Ollech Wajs. Примечательно, что с самого начала своего функционирования, компания поставляет свою продукцию не только на швейцарский рынок, а еще на рынки Великобритании и США. Уже в то время, компания Ollech Wajs компания специализируется на производстве профессиональных часов, например для спортсменов, летчиков, водолазов или солдат. В 60-х годах в компанию поступили заказы от многих военных баз США. Кроме того, практически все солдаты и офицеры, участвующие во Вьетнамской войне, носили именно эти часы. Как и многие другие компании, в начала 80-х годов, Ollech &amp;Wajs вынуждена была прекратить производство (в связи, с так называемым, «кварцевым кризисом»). Но, в конце 20-го века, компания вновь возвращается на всемирный часовой рынок, и действует на нем вплоть до сегодняшнего дня. На данный момент, компания выпускает классические часы с различными модернизациями. Во всех моделях Ollech &amp;Wajs присутствуют различные функции, начиная от вычисления скорости и заканчивая преобразованием мер. Компания выпускает как обычные часы, так и часы с золотым корпусом, которые позиционируются как элитные и роскошные. Часы Ollech Wajs производятся специально для людей, которые предпочитают надежные и высококачественные часы, выполненные в лучших традициях часоделия.</span></span></p>
 
